import React from 'react';

const Signup = () => {

  const style = {
    margin : "20px",
  }

  const labelDiv = {
    border : "1px solid black",
    display : "inline-block",
    padding : "10px",
    marginTop : "10px",
    backgroundColor : "#CACACA",
  }

  const labelFont = {
    fontSize : "20px",
  }

  return (
    <div style={style}>
      <div>
        <h1>회원가입</h1>
      </div>
      <hr />
      <div style={labelDiv}>
        <span style={labelFont}>Member Type</span>
      </div>
    </div>

  );
};

export default Signup;
